import React, { useEffect, useState } from "react";
import './../App.css';

const CallendarCard = ({day, events}) => {
    return(
        <div class="callendar-card">
            <p class="title">dzien: {day} </p>
            <br />
            <p>
            {events.map(event => (
                <>{event.name}</>
            ))}
            </p>
        </div>
    )
}

export default CallendarCard;
